import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
// Components
import Configuration from "../pages/Configuration";
import BranchRegistration from "../pages/BranchRegistration";
import UnmatchedReport from "../pages/UnmatchedReport";
import FieldIdentificationConfig from "../pages/FieldIdentificationConfig";
import OnlineCbrEntry from "../pages/OnlineCbrEntry";

const router = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Configuration />} />
        <Route path="/branch-registration" element={<BranchRegistration />} />
        <Route path="/unmatched-txns-report" element={<UnmatchedReport />} />
        <Route
          path="/field-identification-config"
          element={<FieldIdentificationConfig />}
        />
        <Route path="/online-cbr-entry" element={<OnlineCbrEntry />} />
      </Routes>
    </BrowserRouter>
  );
};

export default router;
